import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./Components/Nav";

const Home = () => (
  <div className="flex justify-center items-center h-screen">
    <div className="grid grid-cols-2 gap-6 p-6 bg-gray-100 rounded-lg shadow-lg">
      <button className="p-6 bg-blue-500 text-white rounded-lg text-lg font-semibold">Data Ingestion</button>
      <button className="p-6 bg-blue-500 text-white rounded-lg text-lg font-semibold">Multichannel View</button>
      <button className="p-6 bg-blue-500 text-white rounded-lg text-lg font-semibold">Model Training</button>
      <button className="p-6 bg-blue-500 text-white rounded-lg text-lg font-semibold">Alerts</button>
      <button className="p-6 bg-blue-500 text-white rounded-lg text-lg font-semibold">Model Testing</button>
      <button className="p-6 bg-blue-500 text-white rounded-lg text-lg font-semibold">FMEA</button>
    </div>
  </div>
);

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
};

export default App;
